import React from 'react';
import MainSlider from '../MainSlider/MainSlider';
import Info from '../Info/Info';
import DiscoverStory from '../DiscoverStory/DiscoverStory';
import DiscoverMenu from '../DiscoverMenu/DiscoverMenu';
import Testimony from '../Testimony/Testimony';
import DiscoverCoffee from '../DiscoverCoffee/DiscoverCoffee';
import Gallery from '../Gallery/Gallery';
import Menu from '../Menu/Menu';
import Form from '../Form/Form';
import { homepage } from '../../content/homepage';
import { services } from '../../content/services';
import { coffee } from '../../content/coffee';
import './Homepage.scss';
import Intro from '../Intro/Intro';

const Homepage = () => (
  <div className="homepage">
    <MainSlider homepage={homepage} />
    <Intro />
    <Info info={services} colorDescription="black" colorTitle="black" />
    <Info
      info={coffee}
      variant="image"
      colorDescription="grey"
      colorTitle="twine"
    />
    <DiscoverStory />
    <DiscoverMenu />
    <Testimony />
    <DiscoverCoffee />
    <Gallery />
    <Menu />
    <Form />
  </div>
);

export default Homepage;
